@A_DiPonio Please see this page for common date formats in email notifications.

https://t.co/44W07Q031t

The date formats are case-sensitive. For instance, "YYYY-MMM-DD" and "YYYY-MM-dd" will result in different text and you more likely want to use "dd" (in lower caps for dates).

@eeeeelizzzzz Sorry for the inconvenience. It looks like Google has made some changes to the Gmail service at their end that has broken all addons that connect to Gmail.

You can track the issue here https://t.co/RvqjWs3iku

As soon as Google fixes the bug, the add-on will resume working.

@MtbUltragr Are are logged into multiple Google accounts in the same browser?

Let's see if this workaround solves the issue. Open Google Chrome, go to the menu and choose New Incognito Window. Here open the same Google Form and try activation again.

Let me know if that resolves the issue?

